  R_V_k1= ( R_g_leak*(p.R_E_leak - R_V(n-1,:)) + p.R_g_ad*(p.R_E_k - R_V(n-1,:)) - (((( p.R_R_IC_g_postIC .* R_R_IC_ICinput(ceil((t+dt*0.01)/dt),:) * R_R_IC_netcon .* (R_V(n-1,:) - p.R_R_IC_E_exc))))+(((( p.R_I_synDoubleExp_gSYN .* ( (( (exp(-(t - I_tspike - p.R_I_synDoubleExp_delay)/p.R_I_synDoubleExp_tauD) - exp(-(t - I_tspike - p.R_I_synDoubleExp_delay)/p.R_I_synDoubleExp_tauR)).*((t - I_tspike - p.R_I_synDoubleExp_delay)>0))) * R_I_synDoubleExp_netcon ).*(p.R_I_synDoubleExp_ESYN - R_V(n-1,:))))))) + p.R_Itonic + p.R_noise*randn(1,p.R_Npop)/dt )/p.R_C;
  C_V_k1= ( C_g_leak*(p.C_E_leak - C_V(n-1)) + p.C_g_ad*(p.C_E_k - C_V(n-1)) - (((( p.C_R_synDoubleExp_gSYN .* ( (( (exp(-(t - R_tspike - p.C_R_synDoubleExp_delay)/p.C_R_synDoubleExp_tauD) - exp(-(t - R_tspike - p.C_R_synDoubleExp_delay)/p.C_R_synDoubleExp_tauR)).*((t - R_tspike - p.C_R_synDoubleExp_delay)>0))) * C_R_synDoubleExp_netcon ).*(p.C_R_synDoubleExp_ESYN - C_V(n-1)))))) + p.C_Itonic + p.C_noise*randn(1,p.C_Npop)/dt )/p.C_C;
  % ------------------------------------------------------------
  % Update state variables:
  % ------------------------------------------------------------
  I_V(n,:)=I_V(n-1,:)+dt*I_V_k1;
  R_V(n,:)=R_V(n-1,:)+dt*R_V_k1;
  C_V(n)=C_V(n-1)+dt*C_V_k1;
  % ------------------------------------------------------------
  % Conditional actions:
  % ------------------------------------------------------------
  conditional_test=(C_V(n,:)>=p.C_V_thresh&C_V(n-1,:)<p.C_V_thresh);
  if any(conditional_test), C_V_spikes(n,conditional_test)=1;inds=find(conditional_test); for j=1:length(inds), i=inds(j); C_tspike(C_buffer_index(i),i)=t; C_buffer_index(i)=mod(-1+(C_buffer_index(i)+1),1)+1; end; end
  conditional_test=(R_V(n,:)>=p.R_V_thresh&R_V(n-1,:)<p.R_V_thresh);
  if any(conditional_test), R_V_spikes(n,conditional_test)=1;inds=find(conditional_test); for j=1:length(inds), i=inds(j); R_tspike(R_buffer_index(i),i)=t; R_buffer_index(i)=mod(-1+(R_buffer_index(i)+1),1)+1; end; end
  conditional_test=(I_V(n,:)>=p.I_V_thresh&I_V(n-1,:)<p.I_V_thresh);
  if any(conditional_test), I_V_spikes(n,conditional_test)=1;inds=find(conditional_test); for j=1:length(inds), i=inds(j); I_tspike(I_buffer_index(i),i)=t; I_buffer_index(i)=mod(-1+(I_buffer_index(i)+1),1)+1; end; end
  conditional_test=(I_V(n,:) >= p.I_V_spike-10);
  if any(conditional_test), I_V(n,conditional_test) = p.I_V_reset; end
  conditional_test=(I_V(n,:) >= p.I_V_thresh & I_V(n,:) < p.I_V_spike-10);
  if any(conditional_test), I_V(n,conditional_test) = p.I_V_spike; end
  conditional_test=(R_V(n,:) >= p.R_V_spike-10);
  if any(conditional_test), R_V(n,conditional_test) = p.R_V_reset; end
  conditional_test=(R_V(n,:) >= p.R_V_thresh & R_V(n,:) < p.R_V_spike-10);
  if any(conditional_test), R_V(n,conditional_test) = p.R_V_spike; end
  conditional_test=(C_V(n) >= p.C_V_spike-10);
  if any(conditional_test), C_V(n,conditional_test) = p.C_V_reset; end
  conditional_test=(C_V(n) >= p.C_V_thresh & C_V(n) < p.C_V_spike-10);
  if any(conditional_test), C_V(n,conditional_test) = p.C_V_spike; end
  % ------------------------------------------------------------
  % Update monitors:
  % ------------------------------------------------------------
  I_I_IC_iIC(n,:)=p.I_I_IC_g_postIC .* I_I_IC_ICinput(ceil((t+dt*0.01)/dt),:) * I_I_IC_netcon .* (I_V(n,:) - p.I_I_IC_E_exc);
  R_R_IC_iIC(n,:)=p.R_R_IC_g_postIC .* R_R_IC_ICinput(ceil((t+dt*0.01)/dt),:) * R_R_IC_netcon .* (R_V(n,:) - p.R_R_IC_E_exc);
  n=n+1;
end

T=T(1:downsample_factor:ntime);

